    ROUND(AVG(3PT_PERCENTAGE), 3) as 3PT_PERCENTAGE, ROUND(AVG(EFG_PERCENTAGE), 3) as EFG_PERCENTAGE, ROUND(AVG(TRUE_SHOOTING_PERCENTAGE), 3) as TRUE_SHOOTING_PERCENTAGE, ROUND(AVG(PPG),1) AS PPG, ROUND(AVG(RPG),1) AS RPG, 
