CREATE DEFINER=`root`@`localhost` PROCEDURE `getTeams`()
SELECT 
	USER_TEAM as TEAM_NAME,
    ROUND(AVG(AGE), 1) as AGE, 
    SUM(FTA) as FTA, 
    ROUND(AVG(FREETHROW_PERCENTAGE), 3) as FREETHROW_PERCENTAGE,
    SUM(2PA) as 2PA,
	ROUND(AVG(2PT_PERCENTAGE), 3) as 2PT_PERCENTAGE,
    SUM(3PA) as 3PA,
    ROUND(AVG(3PT_PERCENTAGE), 3) as 3PT_PERCENTAGE,
	ROUND(AVG(EFG_PERCENTAGE), 3) as EFG_PERCENTAGE,
	ROUND(AVG(TRUE_SHOOTING_PERCENTAGE), 3) as TRUE_SHOOTING_PERCENTAGE,
    SUM(PPG) as PPG,
    SUM(RPG) as RPG,
    SUM(APG) as APG,
    SUM(SPG) as SPG,
    SUM(BPG) as BPG,
    SUM(TOPG) as TOPG
		FROM player p
        JOIN (
        SELECT PLAYER_ID, SEASON_ID, group_concat(team_id) AS TEAM_ID, MAX(age) as AGE, SUM(GAMES_PLAYED) AS GAMES_PLAYED, ROUND(AVG(MPG), 0) AS MPG, ROUND(AVG(MINUTES_PERCENTAGE), 0) AS MINUTES_PERCENTAGE, ROUND(AVG(USAGE_PERCENTAGE), 2) AS USAGE_PERCENTAGE,
	ROUND(AVG(TURNOVER_RATIO), 2) AS TURNOVER_RATIO, SUM(FTA) AS FTA, ROUND(AVG(FREETHROW_PERCENTAGE),3) AS FREETHROW_PERCENTAGE, SUM(2PA) AS 2PA, ROUND(AVG(2PT_PERCENTAGE), 3) AS 2PT_PERCENTAGE, SUM(3PA) as 3PA, 
    ROUND(AVG(3PT_PERCENTAGE), 3) as 3PT_PERCENTAGE, ROUND(AVG(EFG_PERCENTAGE), 3) as EFG_PERCENTAGE, ROUND(AVG(TRUE_SHOOTING_PERCENTAGE), 3) as TRUE_SHOOTING_PERCENTAGE, ROUND(AVG(PPG),1) AS PPG, ROUND(AVG(RPG),1) AS RPG, 
    ROUND(AVG(APG), 1) AS APG, ROUND(AVG(SPG),1) as SPG, ROUND(AVG(BPG),1) as BPG, ROUND(AVG(TOPG),1) as TOPG, ROUND(AVG(ORTG), 1) as ORTG, ROUND(AVG(DRTG),1) as DRTG
    FROM player_season 
	GROUP BY player_id
        ) as ps
        ON p.PLAYER_NAME = ps.PLAYER_id
        WHERE p.USER_TEAM IS NOT NULL
        GROUP BY p.USER_TEAM ;;
DELIMITER ;
